function BusSchedule(){this.schedule=[],this.route_name="",this.init=function(e){this.route_name=e;for(var t,s=document.getElementById(this.route_name+"_table"),h=0;t=s.rows[h];h++)for(var i,l=1;i=t.cells[l];l++){var n=l-1,r=i.innerHTML.replace(/\d+|\s+|:/g,"");this.schedule[n]||(this.schedule[n]=[]),r&&-1===this.schedule[n].find(r)&&this.schedule[n].push(r)}},this.toggleAM=function(e){return this.toggler("AM",e),this},this.togglePM=function(e){return this.toggler("PM",e),this},this.toggler=function(e,t){for(var s=0;s<this.schedule.length;s++)if(1===this.schedule[s].length&&this.schedule[s][0]===e)for(var h=0,i=$.findByClass(this.route_name+"-time-cell-"+s);h<i.length;h++)i[h].style.display=t}}